   "source": [
    "set.seed(2017)\n",
    "N = 1000\n",
    "phi_1 = 0.7\n",
    "phi_2 = 0.2\n",
    "Z = rnorm(N, 0, 1)\n",
    "X = NULL\n",
    "X[1] = Z[1]\n",
    "X[2] = Z[2]\n",
    "for (t in 3:N){\n",
    "    X[t] = Z[t] + X[t-1]*phi_1 + X[t-2]*phi_2\n",
    "}"
   ]
